import React from "react";
import { Menu } from 'antd';
import SearchBar from './SearchBar';

function CenterMenu(props) {
  return (
    <Menu mode={props.mode}>
    <Menu.Item key="mail">
        <SearchBar />
    </Menu.Item>
  </Menu>
  )
}



export default CenterMenu
